import styled from 'styled-components';

const Container = styled.div`
    display: flex; 
    flex-direction: column; 
    height: 100%;
    flex: 1.6;
`;
const ProfileInfoDiv = styled.div`
    display: flex; 
    flex-direction: row; 
    background: #ededed;
    padding: 10px;
`;

const ProfileImage = styled.img`
    width: 32px; 
    height: 32px; 
    border-radius: 50%;
`;

const SearchBox = styled.div`
    background: #f6f6f6;
    padding:10px;
`;

const SearchContainer = styled.div`
    display: flex; 
    flex-direction: row;
    background-color: white;
    border-radius: 16px;

`;


const ContactListComponent = () => {
    return <Container>
        <ProfileInfoDiv>
            <ProfileImage src="./profile/anna.jpg"/>
        </ProfileInfoDiv>
        <SearchBox>
            <SearchContainer>

            </SearchContainer>
        </SearchBox>
        "ContactListComponent"
    </Container>
}

export default ContactListComponent;
